This section defines all the supported Shwap messages, including share identifiers and containers. All the new future messages should be described in the section. RowID RowID identifies the Row shares container in a DataSquare . RowID identifiers are formatted as shown below: RowID { Height: u64; RowIndex: u16;
} The fields with validity rules that form RowID are: Height : A uint64 representing the chain height with the data square. It MUST be bigger than zero. RowIndex : An uint16 representing row index points to a particular row. It MUST not exceed the number of Row roots in DAH . Serialized RowID MUST have a length of 10 bytes. Row Container Row containers are protobuf formatted using the following proto3 schema: syntax = "proto3"; message Row { bytes row_id = 1; repeated bytes row_half = 2;
} The fields with validity rules that form Row containers are: RowID : A RowID of the Row Container. It MUST follow RowID formatting and field validity rules. RowHalf : A two-dimensional variable size byte arrays representing left half of shares in the row. It MUST equal the number of Columns roots in DAH divided by two. These shares MUST only be from the left half of the row. The right half is computed using Leopard GF16 Reed-Solomon erasure-coding. Afterward, the NMT is built over both halves and the computed NMT root MUST be equal to the respective Row root in DAH . SampleID SampleID identifies a Sample container of a single share in a DataSquare . SampleID identifiers are formatted as shown below: SampleID { RowID; ColumnIndex: u16; } The fields with validity rules that form SampleID are: RowID : A RowID of the sample. It MUST follow RowID formatting and field validity rules. ColumnIndex : A uint16 representing the column index of the sampled share; in other words, the share index in the row. It MUST stay within the number of Column roots in DAH . Serialized SampleID MUST have a length of 12 bytes. Sample Container Sample containers encapsulate single shares of the DataSquare . Sample containers are protobuf formatted using the following proto3 schema: syntax = "proto3"; message sample { bytes sample_id = 1; bytes sample_share = 2; Proof sample_proof = 3; ProofType proof_type = 4;
} enum ProofType { RowProofType = 0; ColProofType = 1;
} The fields with validity rules that form Sample containers are: SampleID : A SampleID of the Sample container. It MUST follow SampleID formatting and field validity rules. SampleShare : A variable size array representing the share contained in the sample. Each share MUST follow share formatting and validity rules. Proof : A protobuf formated NMT proof of share inclusion. It MUST follow NMT proof verification and be verified against the respective root from the Row or Column axis in DAH . The axis is defined by the ProofType field. ProofType : An enum defining which axis root the Proof is coming from. It MUST be either RowProofType or ColumnProofType. DataID DataID identifies namespace Data container of shares within a single Row. That is, namespace shares spanning over multiple Rows are identified with multiple identifiers. DataID identifiers are formatted as shown below: DataID { RowID; Namespace;
} The fields with validity rules that form DataID are: RowID : A RowID of the namespace data. It MUST follow RowID formatting and field validity rules. Namespace : A fixed-size bytes array representing the Namespace of interest. It MUST follow Namespace formatting and its validity rules. Serialized DataID MUST have a length of 39 bytes. Data Container Data containers encapsulate user-submitted data under namespaces . Data containers are protobuf formatted using the following proto3 schema: syntax = "proto3"; message Data { bytes data_id = 1; repeated bytes data_shares = 2; Proof data_proof = 3;
} The fields with validity rules that form Data containers are: DataID : A DataID of the Data container. It MUST follow DataID formatting and field validity rules. DataShares : A two-dimensional variable size byte arrays representing left data shares of a namespace in the row. Each share MUST follow share formatting and validity rules. Proof : A protobuf formated NMT proof of share inclusion. It MUST follow NMT proof verification and be verified against the respective root from the Row or Column axis in DAH . The axis is defined by the ProofType field. Namespace data may span over multiple rows, in which case all the data is encapsulated in multiple containers. This is done
